// App.js
import React from 'react';
import { BrowserRouter as Router, Route,Routes } from 'react-router-dom';
import FetchUser from '../src/Components/FetchUser';
import RepositoryDetails from '../src/Components/RepositoryDetails';

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<FetchUser />} />
        <Route path="/repository/:username/:repoName" element={<RepositoryDetails />} />
      </Routes>
    </Router>
  );
};

export default App;
